import './App.css';
import Navbar from './components/incl/navbar';
import TopBar from './components/incl/topbar';

function App() {
  return (

    <div id="bg-default">


      <Navbar />
      <div className='row'>
        <div className='col-lg-12'>
          <div className='col-lg-2'></div>
          <div className='main-content ss clearfix' id='panel'>
            <TopBar />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
